import React, { Component } from 'react';
import "./home.css";


export default class Home extends Component {

    render() {
      return (
        <div id="Home-content">
            <div id="background-img"/>
            <div id="slogans">
                <h1>Fysisk og Mentalt Overskud</h1>
                <h1>Mere robust</h1>
            </div>
            <div id="content"> 
            </div> 
        </div>

      );
    }
}
